import React, { useState, useEffect }  from 'react';
import { useNavigate } from 'react-router-dom';
import './../employee/css/EmployeeDashboardPage.css'; // Add custom styles
import Notification from './../../Notification'; // Import the Notification component

function EmployeeDashboardPage() {
  const [transactions, setTransactions] = useState([]);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // Fetch pending transactions for employee verification
  useEffect(() => {
    fetch('http://localhost:5000/api/employee/transactions', {
      method: 'GET',
      headers: {
        'Authorization': `Bearer ${localStorage.getItem('token')}`,
      },
    })
      .then(response => response.json())
      .then(data => setTransactions(data))
      .catch(err => {
        console.error(err);
        setError('Failed to load transactions');
      });
  }, []);

  // Handle transaction verification (mark as verified)
  const handleVerify = async (transactionId) => {
    try {
      const response = await fetch(`http://localhost:5000/api/employee/verify/${transactionId}`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${localStorage.getItem('token')}`,
        },
      });

      if (response.ok) {
        setTransactions(prevTransactions =>
          prevTransactions.map(tx =>
            tx.id === transactionId ? { ...tx, status: 'verified' } : tx
          )
        );
      } else {
        const error = await response.json();
        setError(error.message || 'Verification failed');
      }
    } catch (err) {
      console.error(err);
      setError('An error occurred while verifying the transaction.');
    }
  };

  // Handle flagging transaction as suspicious
  const handleFlag = async (transactionId) => {
    try {
      const response = await fetch(`http://localhost:5000/api/employee/flag/${transactionId}`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${localStorage.getItem('token')}`,
        },
      });

      if (response.ok) {
        setTransactions(prevTransactions =>
          prevTransactions.map(tx =>
            tx.id === transactionId ? { ...tx, status: 'flagged' } : tx
          )
        );
      } else {
        const error = await response.json();
        setError(error.message || 'Flagging failed');
      }
    } catch (err) {
      console.error(err);
      setError('An error occurred while flagging the transaction.');
    }
  };

  return (
    <div className="employee-dashboard-container">
      <h2>Employee Dashboard</h2>

      {/* Error Message */}
      {error && <p style={{ color: 'red' }}>{error}</p>}

      {/* Transaction History */}
      <h3>Pending Transactions</h3>
      <table>
        <thead>
          <tr>
            <th>Amount</th>
            <th>Currency</th>
            <th>Provider</th>
            <th>Status</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {transactions.length === 0 ? (
            <tr>
              <td colSpan="5">No pending transactions</td>
            </tr>
          ) : (
            transactions.map((transaction) => (
              <tr key={transaction.id}>
                <td>{transaction.amount}</td>
                <td>{transaction.currency}</td>
                <td>{transaction.provider}</td>
                <td>{transaction.status}</td>
                <td>
                  <button
                    disabled={transaction.status === 'verified' || transaction.status === 'flagged'}
                    onClick={() => handleVerify(transaction.id)}
                  >
                    Verify
                  </button>
                  <button
                    disabled={transaction.status === 'verified' || transaction.status === 'flagged'}
                    onClick={() => handleFlag(transaction.id)}
                  >
                    Flag
                  </button>
                </td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
}

export default EmployeeDashboardPage;
